import React from 'react'
import Slider from 'infinite-react-carousel';
import { CssBaseline, Grid, Box, Typography, Button } from '@material-ui/core';
import { makeStyles, withStyles } from '@material-ui/core/styles'; 



const useStyles = makeStyles((theme) => ({
  screenshot: {
    // transform: 'rotate(-30deg)',
    width: 'calc(30rem + 10vw)',
    height: 'auto',
    padding: '5px',
    alignContent: 'center',
  },  
})); 

export default function Carousel () {
  const classes = useStyles();  
  return (
    <Slider dots>
      <div>
        <Grid item xs={12}>
          <Box>
              <Typography>
                  <img src={`${process.env.PUBLIC_URL + '/assets/Carousel_1.svg'}`} className={classes.screenshot} ></img>
              </Typography>
          </Box>
        </Grid>
      </div>
      <div>
        <Grid item xs={12}>
          <Box>
              <Typography>
                  <img src={`${process.env.PUBLIC_URL + '/assets/Carousel_2.svg'}`} className={classes.screenshot} ></img>
              </Typography>
          </Box>
        </Grid>
      </div>
      <div>
      <Grid item xs={12}>
          <Box>
              <Typography>
                  <img src={`${process.env.PUBLIC_URL + '/assets/Carousel_3.svg'}`} className={classes.screenshot} ></img>
              </Typography>
          </Box>
        </Grid>
      </div>
    </Slider>
  );
}
